    const [product, setProduct] = useState({})

useEffect(() => {
    axios
    .get("http://localhost:8000/product-detail/" + props.id)
})

    return (
        <div>
            <Link to="/products">Go Home</Link>
            <h3>Product Information</h3>
        </div>
    )
}

export default Detail
